(1, 'KTM 450 SX-F 2020', '35', '35', '', '2020-09-06', '2021-01-30', '100', 'KTM 450 SX-F 2020', '     All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\nKTM 450 SX-F 2020 (Brand new)\r\nThe championship-winning KTM 450 SX-F is a proven formula that is the industry benchmark. For 2020, this machine continues to deliver superior performance and easy handling. It features an extremely compact, single overhead camshaft cylinder head, and together with the efficient electronic fuel injection, it pushes out an unrivaled 63hp in the most effective way possible. The KTM 450 SX-F is simply the fastest Motocross bike out on the track. '),
(3, 'HUBLOT CLASSIC', '15', '15', '', '2020-09-06', '2020-10-31', '5', 'HUBLOT CLASSIC', '  All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\nDiamond prizes, win your dreams with this :\r\nHUBLOT CLASSIC FUSION TITANIUM KING GOLD 511.NO.1181.LR 45MM\r\n'),
