(5, 'Balenciaga Triple S', '3', '3', '', '2020-09-06', '2020-10-31', '5', 'Balenciaga Triple S', '  All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\n Balenciaga’s Triple S sneakers have been an icon of streetwear culture ever since their runway debut in 2017. Often imitated but never equaled, the silhouette is named after its triple-stacked sole – a statement foundation for the dynamic panelled upper that sees suede fused with athletic mesh inserts. They’re not a product of the current chunky trend, but rather the shoes that started it all.'),
(7, '£3000 Cash', '11.50', '11.50', '', '2020-09-06', '2021-01-31', '100', '£3000 Cash', '       All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\n   Diamond prizes are offering you the chance to win £3000.00 direct to your UK or RI bank account.\r\n '),
(8, '£5000 Harrods Card', '6.50', '6.50', '', '2020-09-06', '2020-10-12', '25', '£5000 Harrods Card', '     Diamond prizes are so excited to give one lucky person a gift card worth £5000 to spend in Harrods!\r\nWin your dreams with Diamond prizes  '),
(9, 'Ipad 32gb', '1.00', '1', '', '2020-09-06', '2021-01-31', '600', 'Ipad 32gb', '         Diamond prizes are excited to giveaway this Apple Ipad.\r\nCreate, learn, work, and play like never before on the immersive 10.2-inch Retina display. Support for the Smart Keyboard and Apple Pencil. Over a million apps available on the App Store, including Apple Arcade games. Front and back cameras. Wi-Fi. All-day battery life. And it comes with iPadOS, which unlocks a whole new world of capability. It’s unbelievably fun. And unmistakably iPad.'),
(12, 'Nintendo Switch ', '1.50', '1.50', '', '2020-09-06', '2021-01-31', '25', 'Nintendo Switch ', '    Diamond prizes are excited to giveaway this \r\nNintendo Switch (Neon Red/Neon Blue)'),
