(15, 'Iphone 11 Pro Max', '2.00', '2', '', '2020-09-07', '2021-01-31', '25', 'Iphone 11 Pro Max', '    \r\n\r\n\r\n\r\n\r\n\r\nDiamond prizes are excited to giveaway this iPhone 11 Pro Max 64GB\r\n- A13 Bionic chip\r\n- Third?generation Neural Engine\r\n- Triple 12MP Ultra Wide, Wide, and Telephoto cameras\r\n- Super Retina XDR display\r\n- IP68 Splash, Water, and Dust Resistant\r\n- Wireless charging\r\n- 802.11ax Wi?Fi 6\r\n- Gigabit?class LTE\r\n- Lasts up to 5 hours longer than iPhone XS Max\r\n- Face ID '),
(17, 'Apple Iwatch 5', '3', '3', '', '2020-09-08', '2020-11-30', '300', 'Apple Iwatch 5', '   Diamond Prizes are giving away this Apple iwatch 5\r\n\r\nOperating system: Watch OS 5 \r\nStorage capacity: 32GB\r\nProcessor: Apple S5\r\nIntelligent assistant: Siri\r\nDisplay: LTPO OLED display\r\nConnectivity: Wi-Fi, Bluetooth\r\nBattery: Lithium-ion battery'),
(18, '75 Inch, Ultra HD', '2.00', '2', '', '2020-09-09', '2020-11-30', '25', '75 Inch, Ultra HD', '    Diamond prizes can not wait to give away this \r\nLG 75UM7050 75 inch 4K Smart TV.\r\nSTUNNING 4K PICTURE QUALITY\r\nTreat your eyes to this stunning 4K Active HDR TV for all your  TV shows, streamed services, and more. Watch your content come to life thanks to a 3840 x 2160 Ultra HD resolution powered by a quad-core processor, making everything more lifelike and immersive.'),
(19, 'LG 75 INCH Ultra HD', '5', '5', '', '2020-09-09', '2020-12-31', '25', 'LG 75 INCH Ultra HD', '   LG 75UM7050 75 inch 4K Smart TV.\r\nSTUNNING 4K PICTURE QUALITY\r\nTreat your eyes to this stunning 4K Active HDR TV for all your  TV shows, streamed services and more. Watch your content come to life thanks to a 3840 x 2160 Ultra HD resolution powered by a quad-core processor, making everything more lifelike and immersive.'),
(21, '2 Night Trip: Rovani', '10', '10', '', '2020-09-09', '2020-10-31', '25', '2 Night Trip: Rovani', ' (IF COVID STOPS TRAVEL OR THE WINNER FEELS UNSAFE TO TRAVEL WE WILL EXCHANGE THE TRIP FOR £4000/€4000 CASH)\r\n\r\n Santa’s Sleighbell Spectacular\r\nExperience the snowy magic of Lapland and visit Joulukka\r\nDAY ONE\r\nARRIVAL TO LAPLAND\r\n\r\nMeals included breakfast & dinner\r\n\r\nOur day begins with an early morning flight from Dublin airport to Lapland. During the flight a light breakfast will be served and subject to crew permission the festive fun will begin. There will be Christmas singing, colouring, drawing and lots of very excited children.\r\n\r\nOn arrival at Rovaniemi airport - the official airport of Santa Claus you will be met by our elves who will guide you throughout your stay and help you search for Santa.\r\n\r\nOnce you have checked into your chosen accommodation and collected your special thermal clothing we will begin our wintry adventure.\r\n\r\nWe will set off for a short 30 minute snowmobile safari through the snow covered forests. Adults will drive 2 persons per snowmobile and the children will travel in the sledges pulled by one of our guides.\r\n\r\nAfter a long day we will head back to our hotels where you can enjoy a relaxing sauna and buffet dinner.\r\nDAY TWO\r\nA FULL DAY OF WINTER SNOW FUN\r\n\r\nMeals included Breakfast, Lunch, Festive dinner and Show\r\n\r\nAfter breakfast, you will be met by our guides at your hotel. We will take a coach to the surrounding wilderness and begin our wintry adventure, where you will get to enjoy the following activities on the day.\r\n\r\nHusky ride\r\nWe will visit a husky farm, where you will learn about the life of the husky dog. We will get to enjoy a short (800m) but speedy ride in sledges pulled by these arctic huskies. In the warmth of the chamber you can enjoy a hot drink and biscuits.\r\n\r\nReindeer ride\r\nYou will visit a reindeer farm, where you will experience the magical ceremony of crossing the Arctic Circle in a kota-tepee. You will also get to enjoy the fun of a short (400m) reindeer ride. Upon completion of your reindeer driving, your guide will issue you with a special reindeer licence.\r\n\r\nLunch\r\nDuring the day we will take a break from the activities and \'recharge our batteries\' by enjoying a nice hot lunch in a cosy restaurant.\r\n\r\nJoulukka\r\n\"Listen carefully as you may hear some footsteps, could it be an Elf?\" Later in the day we will make our way to Joulukka, a unique place in the middle of the deep forest, where the magic of Christmas comes alive. Here we will visit the Elf school & Santa\'s Command Centre.\r\n\r\nTobogganing\r\nWe will enjoy the thrills of speedy tobogganing at Joulukka.\r\n\r\nElf school\r\nHere you will discover how Elves spend their days busily getting ready for Christmas. You will have a chance to decorate your own tasty gingerbread with the help of an Elf.\r\nDAY THREE\r\nSANTA CLAUS VILLAGE & DEPARTURE\r\n\r\nMeals included breakfast and lunch\r\n\r\nAlas, the day of departure is upon us. After breakfast, we will check out of our hotels and we will make a visit to Santa Claus Village at the Arctic Circle. There we will have time for some shopping in the souvenir and handicraft shops, for those who wish to take a \'Taste of Lapland\' home with them. You will also have time to write and send your letters and postcards from Santa\'s Official Post Office.\r\n\r\nFinally, it\'s time to take a short coach transfer back to Rovaniemi airport for our flight home to Dublin and bid a happy farewell to the land of Santa Claus. A light meal will be served onboard the aircraft. '),
