(25, 'Trio Pouch', '5.00', '5', '', '2020-09-10', '2020-12-31', '300', 'Trio Pouch', '  Diamond Prizes will giveaway this Louis Vuitton Trio Pouch The Trio Pouch is an ingenious design combining three different pouches in three variations of Louis Vuitton\'s iconic Monogram canvas. Ideal for essentials, the pouches can be used together or separately and carried in the hand by the wristlet or attached to a bag or belt. They are secured with gold-tone LV Circle zips. Detailed features 19.5 x 11.5 x 3.0 cm (Length x Height x Width) Round coin purse: L 10 x H 10 cm Square pouch: L 12 x H 12 cm Rectangular pouch: L 19,5 x H 10 cm Monogram Giant, Monogram Reverse and Monogram Mini coated canvas Cowhide-leather trim Cowhide-leather lining Gold-color hardware Wristlet LV Circle zip closure Handle: Single, removable'),
(26, 'Flannels (£300)', '1', '2', '', '2020-09-10', '2020-12-31', '500', 'Flannels (£300)', '  Diamond Prizes are giving away this £300 voucher to spend at Flannels.com'),
(27, 'TAG HEUER', '2.00', '2', '', '2020-09-10', '2020-12-31', '1000', 'TAG HEUER', ' All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\n Diamond prizes will giveaway this Tag Heuer aquaracer 43mm mens Watch.\r\nDesigned for life beneath the waves, the Aquaracer collection prioritises reliability, durability and performance above all else. All watches are exposed to a variety of open water tests, including salt water, pressure, and heat testing – ensuring that they’re perfectly suited to sailing, diving, and surfing adventures.\r\n\r\nThis TAG Heuer AquaRacer Men’s Watch is powered by a Swiss-made quartz movement and is water resistant to 300 metres, making it perfect for every adventure.\r\n\r\nThe stunning blue dial is set within a polished stainless steel 43mm case with a unidirectional ceramic blue bezel and is equipped with luminescent hands and baton hour markers, as well as a date display at 3 o’clock.\r\n\r\nWater resistant up to an impressive 300 metres, this high performance timepiece fastens with a brushed steel bracelet with folding clasp, double safety push buttons and a diving extension'),
(28, 'Xiaomi Mi M365', '1.25', '1.25', '', '2020-09-13', '2020-12-31', '25', 'Xiaomi Mi M365', '    Diamond prizes, Win your dreams with this:\r\nXiaomi Mi M365 Electric Scooter - Black\r\n\r\nMaximum Speed : 15.5mph\r\nMaximum Range :18.6 Miles / 30km\r\nApprox. Charge Time : 5 Hours'),
(30, 'Playstation 5', '3.50', '3.50', '', '2020-09-18', '2021-01-31', '100', 'Playstation 5', ' Diamond prizes are giving away this Playstation 5 \r\nand are offering this on 300 club, \r\nOnly 300 tickets are available.'),
(31, '£100.00 Cash', '3.00', '', '', '2020-09-25', '2020-09-29', '5', '£100.00 Cash', ' All prizes are delivered to the UK and the Republic of Ireland.\r\n\r\n Diamond Prizes will give you £100.00 Cash straight into your bank account.\r\nWin your dreams'),
(32, '50.00 Dominoes', '2.50', '', '', '2020-09-25', '2020-10-02', '50', '50.00 Dominoes', '   Diamond prizes will send a dominoes delivery to your door in the UK or Ireland to the value of £50/€50'),
(39, 'ZIPPER 50CC', '2.00', '2', '', '2020-10-09', '2021-01-31', '25', 'ZIPPER 50CC', '    Diamond prizes are giving away this ZIPPER 50CC PETROL MINI KIDS DIRT MOTORBIKE.\r\n\r\n\r\n The motorbike is suitable for all weather conditions. It\'s a strong bike with alloy frame, front aluminium telescopic fork and hard wearing grippy rubber tyres that can handle some fun off road action. It\'s super easy to use with simple twist to go throttle and front/rear vented brakes. The 2-stroke engine is the new easy-start type and runs on a mix of normal unleaded mixed with engine oil.\r\n\r\nThe draw will go ahead live once all tickets are sold'),
(40, 'Veneers', '10', '10', '', '2020-11-15', '2020-12-09', '50', 'Veneers', '     Diamondprizes are giving one lucky winner the chance to win a full set of porcelain veneers up to the value of £10,000 or €10,000 in the UK or ROI.\r\nWith only 1500 tickets available the odds are excellent.\r\n\r\nWin Your Dreams with Diamond Prizes'),
